@zubairahmed-ai How do you plan to compile ML models? (Keep in mind that DLR is a runtime only, so compilation will need to occur somewhere.) Currently, Amazon SageMaker Neo only supports Linux targets:

<img width="347" alt="screen shot 2019-02-04 at 11 51 44 pm" src="https://user-images.githubusercontent.com/2532981/52259515-da79b600-28d7-11e9-8dcf-a9e8c57c8a00.png">

So to compile ML models to run in Windows machines, we'll need to use [TVM](https://github.com/dmlc/tvm) and [Treelite](https://github.com/dmlc/treelite) directly. Would you be able to explain your potential use cases, so that we can provide some pointers as to how to proceed with compilation.
